import Type from '../lib/Type'

export const any = Type.is('any', (value: any): value is any => true)
export const nothing = Type.literal(null).or(Type.literal(undefined))

export const boolean = Type.is(
  `a boolean`,
  (value: any): value is boolean => typeof value === 'boolean',
)

export const string = Type.is(
  `a string`,
  (value: any): value is string => typeof value === 'string',
)

export const symbol = Type.is(
  `a symbol`,
  (value: any): value is symbol => typeof value === 'symbol',
)

export const number = Type.is(
  `a number`,
  (value: any): value is number => typeof value === 'number' && value === value,
)

export const object = Type.is(
  `an object`,
  (value: any): value is object => value != null && typeof value === 'object',
)

export const fn = Type.is(
  `a function`,
  (value: any): value is Function => typeof value === 'function',
)

export const dictionary = Type.object(string)
export const enumerable = Type.object(number)

export const int = number.and(
  Type.is(
    'an integer',
    (value: any): value is number =>
      Math.floor(value) === value && value !== Infinity,
  ),
)

export const int8 = int.and(Type.range(-128, 127))

export const uint = number.and(
  Type.is(
    'a positive integer',
    (value: any): value is number =>
      Math.floor(value) === value && value >= 0 && value !== Infinity,
  ),
)

export const uint8 = uint.and(Type.range(0, Math.pow(2, 8) - 1))
export const uint16 = uint.and(Type.range(0, Math.pow(2, 16) - 1))
export const uint32 = uint.and(Type.range(0, Math.pow(2, 32) - 1))
